$("#buttonExportPdf").click(function(){
    var nbPages = 0;
    
	CacherAdmin1();
    ZoomParDefaut();
    
    //ZOOM CARTE POUR AVOIR PLUS DE QUALITE
	widthOrigin = $('#carte').css("width").replace('px','');
    heightOrigin = $('#carte').css("height").replace('px','');
	$("#carte").css('transform', 'scale(4)');
	vbY = 90*4;
	vbW = 842*4;
	vbH = 595*4;
	width = $('#carte').css("width").replace('px','');
    height = $('#carte').css("height").replace('px','');
	$("#carte").attr({"width":vbW+"px","height":vbH+"px"});
	$("#carte").attr({"viewBox":"0 180 "+vbW+" "+vbH+""});

	
	
    
    //COPIE DE LA CARTE
	$('<canvas id="canvasCarte" class="captureZone" width="'+vbW+'px" height="'+vbH+'px" style="position:absolute;z-index:0"></canvas>').appendTo('body');
	canvas = document.getElementById('canvasCarte');
	// console.log("1:"+canvas.height+" "+canvas.width);
    canvg(document.getElementById('canvasCarte'),$('#carte')[0].outerHTML);
	// console.log("2:"+canvas.height+" "+canvas.width);
    $('#carte').hide();
    $('.menuZoom').hide();
    //$('#canvasCarte').css({"width":width+'px',"height":height+'px'});
    //$('#canvasCarte').css({"left":$('#carte').css("left"),"top":$('#carte').css("top")});
    
	
    
	html2canvas(($("#canvasCarte")), {
        onrendered: function(canvas) {
            //console.log("3:"+canvas.height+" "+canvas.width);
            //EXPORT PDF
            
            
            var doc = new jsPDF();
            var pos = 0;
			var smallFontSite = 9;
			var extraSmallFontSite = 8;
			var tmpAcutalite = [];
			var tmpActualiteDetails = [];
			var tmpLineIndexToWrite = 0;
			var tmpActualiteExist = false;

            //AJOUT DE LA CARTE
            // //console.log(canvas.width);
            heightCarte = (canvas.height/(canvas.width/190));
			
			imgData= canvas.toDataURL('image/png');
            doc.addImage(imgData, 'png', 10, 45, 190,heightCarte);
            pos = 55+heightCarte;

      
            
			//AJOUT DE LA LEGENDE	
            /*BLEU*/ doc.addImage("data:image/jpeg;base64,", 'JPEG', 10, 150, 5,5);
            /*VERT*/ doc.addImage("data:image/jpeg;base64,", 'JPEG', 10, 158, 5,5);
			/*ORANGE*/ doc.addImage("data:image/jpeg;base64,", 'JPEG', 10, 166, 5,5);
			/*GRIS*/ doc.addImage("data:image/jpeg;base64,", 'JPEG', 10, 174, 5,5);
			doc.setFontSize(8);
			doc.text(17, 153, "Natural disaster");
			doc.text(17, 161, "Epidemic");
			doc.text(17, 169, "Conflict");
			doc.text(17, 177, "Other");
			
			
			
			
			

            //ECRITURE DE L'ENTETE
            doc.setTextColor("#ffffff");
            doc.setFillColor(0, 153, 255);
            doc.rect(10, 10, 190, 17, "F");
            doc.setFontSize(20);
            doc.setFontType("bold");
            doc.text(15, 18, "Weekly humanitarian snapshot");
            doc.setFontSize(12);
            doc.setFontType("normal");
            doc.text(16, 24, "West and Central Africa");
            
			doc.setFontSize(35);
            //doc.setFontType("bold");
            doc.text(160, 23, "OCHA");
			doc.setFontType("normal");
            imgData = 'data:image/png;base64,';
            doc.addImage(imgData, 'png', 145, 12, 14, 14);
            
			


            //AFFICHAGE DES FILTRES
			doc.setTextColor("#000000");
			doc.setFontSize(smallFontSite);
			doc.text(10, 34, "Countries");
			doc.text(10, 38, "Themes");
			doc.text(10, 42, "Period");
            if(filtresPays.length==0){
                doc.text(24, 34, ": All");
            }else{
                doc.text(24, 34, ": "+ArrayToVar2(filtresPays,listePays,", "));
            }
            if(filtresThemes.length==0){
                doc.text(24, 38, ": All");
            }else{
                doc.text(24, 38, ": "+ArrayToVar2(filtresThemes,listeThemes,", "));
            }

			var date1 = new Date(DateFrToDateEn($("#dateStart").val()));
			var date2 = new Date(DateFrToDateEn($("#dateEnd").val()));
			var period = TwoDateToText(date1,date2);
            doc.text(24, 42, ": "+period+"");



            //ECRITURE DU PIED DE PAGE
            doc.setTextColor("#a0a0a0");
            doc.setFontSize(extraSmallFontSite);
            var today = new Date();
            doc.text(10, 283, "Map data sources: UNCS, DevInfo, OCHA. Feedback: ocharowca@un.org Twitter: @OCHAROWCA");
			doc.setFontStyle("italic");
            doc.text(10, 286, "The boundaries and names shown and the designations used on this map do not imply official endorsement or acceptance by the United Nations.");
			doc.setFontStyle("normal");
			doc.setTextColor("#000000");
            nbPages++;
            ni = 0;
            writeCountry = true;
			
			
			
            for(i=0; i < listeActualites.length; i++) {
                if(pos<260){
                    
					//ECRITURE SUITE PARAGRAPHE EN LIGNE BREAK SUITE SUR PAGE SUIVANTE
					if(tmpActualiteExist){
						for(q=tmpLineIndexToWrite; q < tmpActualiteDetails.length; q++) {
							if((pos+4)<280){
								doc.text(10, pos, tmpActualiteDetails[q]);
								tmpLineIndexToWrite++;
							}
							pos = pos+4;
						}
						
						tmpActualiteExist = false;
						tmpActualiteDetails = [];
						tmpLineIndexToWrite = 0;
					}
					
					
					
					
                    //PAYS ET REGION
					doc.setFontSize(12)
                    ni = i+1;
                    var paysRegion = listeActualites[i][3];
                    var paysRegionNext = "";
                    if(ni<listeActualites.length){
                        paysRegionNext = listeActualites[ni][3];
                    }

                    if(writeCountry){
                        doc.text(10, pos, paysRegion);
                    }

                    if(paysRegionNext!=paysRegion){
                        writeCountry = true;
                    }else{
                        writeCountry = false;
                    }

					
					//TITRE ICONE DETAILS DATE
                    pos = pos+6;
                    doc.setFontSize(smallFontSite);
					var vDate = formattedDateFrench(new Date(listeActualites[i][12]));
                    doc.text(20, pos, vDate);
                    doc.setFontSize(10);
                    doc.setTextColor("#0099ff");
                    
                    /* OUBLIE
                    if(listeActualites[i][14]==undefined){
                        doc.text(38, pos, listeActualites[i][10]);
                    }else{
                        doc.text(38, pos, listeActualites[i][10]+" ("+listeActualites[i][14]+")");
                    }*/
                    doc.text(38, pos, listeActualites[i][10]);
                    
                    var imgData = GetImage(listeActualites[i][0]+listeActualites[i][13]);
                    doc.addImage(imgData, 'JPEG', 10, (pos-5), 7, 7);
                    doc.setTextColor("#000000");
                    doc.setFontSize(smallFontSite);
                    pos = pos+6;

                    var details = MakeToArray(listeActualites[i][11]);
                    // //console.log(details);
                    doc.text(10, pos, details);

                    pos = pos+(details.length * 4);
					
					if(writeCountry){
						pos = pos + 8;
                    }else{
						pos = pos - 3;
                    }
                }else{
					
					//ECRITURES D'UNE ACTUALITE AVEC UNE SUITE SUR LA PAGE SUIVANTE
					tmpAcutalite = listeActualites[i+1];
					if(tmpAcutalite != undefined){
						
					
						//console.log("tmp actv "+pos);
						//console.log(tmpAcutalite);
						
						
						//ECRITURE DU TITRE
						if((pos+6)<280){
							//console.log("tmp act:write:"+tmpAcutalite[10]);
							if(writeCountry){
								doc.setFontSize(12);
								doc.text(10, pos, tmpAcutalite[3]);
								writeCountry = false;
							}
							
							pos = pos+6;
							doc.setFontSize(smallFontSite);
							var vDate = formattedDateFrench(new Date(tmpAcutalite[12]));
							doc.text(20, pos, vDate);
							doc.setFontSize(10);
							doc.setTextColor("#0099ff");
							
							doc.text(38, pos, tmpAcutalite[10]);
							
							var imgData = GetImage(tmpAcutalite[0]+tmpAcutalite[13]);
							doc.addImage(imgData, 'JPEG', 10, (pos-5), 7, 7);
							doc.setTextColor("#000000");
							doc.setFontSize(smallFontSite);
							pos = pos+6;
							
							//ECRITURE DES DETAILS
							tmpActualiteDetails = MakeToArray(tmpAcutalite[11]);
							for(q=0; q < tmpActualiteDetails.length; q++) {
								if((pos+4)<280){
									doc.text(10, pos, tmpActualiteDetails[q]);
									tmpLineIndexToWrite++;
								}
								pos = pos+4;
							}
							
							tmpActualiteExist = true;
							i++;
						}
					}
					
                    doc.addPage();
                    nbPages++;
                    pos = 10;
                }



            }
            
            //ECRITURES DES NUMEROS DE PAGES
            for(i=1; i <= nbPages; i++) {
                doc.setPage(i);
                doc.text(185, 294, "Page "+i+" of "+nbPages);
            }

            doc.save('autoprint.pdf');
            
            
            //FIN EXPORT PDF
            
            $('#canvasCarte').remove();
            $('.menuZoom').show();
			
			
			//ZOOM RESTAURER LE ZOOM PAR DEFAUT
			$( "#carte" ).css('transform', 'scale('+zoom+')');
			$("#carte").attr({"width":widthOrigin+"px","height":heightOrigin+"px"});
			$("#carte").attr({"viewBox":"0 0 "+widthOrigin+" "+heightOrigin});
			
			CacherAdmin1();
			ZoomParDefaut();
			$('#carte').show();
        },
    background:"#ffffff",
        letterRendering:true
    });

    
	
	ZoomParDefautKeepingAdmin();
});
